"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     Barkley KT. Ambulances of the future. In: The Ambulance: The Story of Emergency Transportation of the sick and wounded through the centuries, Kiamesha Lake, New York 1978. p.171.",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?17/4/17482/abstract/2\">",
"      Brewer LA 3rd. Baron Dominique Jean Larrey (1766-1842). Father of modern military surgery, innovater, humanist. J Thorac Cardiovasc Surg 1986; 92:1096.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?17/4/17482/abstract/3\">",
"      Boyd DR. The conceptual development of EMS systems in the United States, Part I. Emerg Med Serv 1982; 11:19.",
"     </a>",
