" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Action of hematopoietic growth factors on progenitor cells",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Lineage stem cell",
"       </td>",
"       <td class=\"subtitle1\">",
"        Required growth factors",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        CFU-GEMM",
"       </td>",
"       <td>",
"        SCF + IL-3, IL-6, GM-CSF, EPO",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        BFU-E",
"       </td>",
"       <td>",
"        SCF + IL-3, GM-CSF, EPO",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        CFU-GM",
"       </td>",
"       <td>",
"        SCF + G-CSF or M-CSF plus GM-CSF, IL-3",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        CFU-G",
"       </td>",
"       <td>",
"        SCF + G-CSF plus GM-CSF, IL-3",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        CFU-M",
"       </td>",
"       <td>",
"        SCF + M-CSF plus GM-CSF, IL-3",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        CFU-Meg",
"       </td>",
"       <td>",
"        SCF + IL-3, IL-6, TPO",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
