var content_f17_4_17485=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F68554&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F68554&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Temsirolimus for the initial treatment of poor-prognosis metastatic renal cell carcinoma",
"    <sup>",
"     [1]",
"    </sup>",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"4\" width=\"25%\">",
"     </colgroup>",
"     <tbody>",
"      <tr class=\"divider_bottom\">",
"       <td colspan=\"4\">",
"        Cycle length: Weekly.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Drug",
"       </td>",
"       <td class=\"subtitle1\">",
"        Dose and route",
"       </td>",
"       <td class=\"subtitle1\">",
"        Administration",
"       </td>",
"       <td class=\"subtitle1\">",
"        Given on days",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Temsirolimus",
"        </strong>",
"       </td>",
"       <td>",
"        25 mg IV*",
"       </td>",
"       <td>",
"        Dilute in 250 mL normal saline (NS) and infuse via an infusion pump over 60 minutes for the first dose",
"        <sup>",
"         &Delta;",
"        </sup>",
"        . Subsequent doses may be given over 30 minutes if tolerated.",
"       </td>",
"       <td>",
"        Once weekly",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Pretreatment considerations:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Emesis risk:",
"        </strong>",
"        LOW (10 to 30 percent frequency of emesis). Refer to UpToDate topic on \"Prevention and treatment of chemotherapy-induced nausea and vomiting\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Prophylaxis for infusion reactions:",
"        </strong>",
"        Temsirolimus has caused hypersensitivity reactions, including anaphylaxis, which can occur with the initial as well as subsequent infusions. Premedication with an H1-antagonist such as diphenhydramine is recommended. Refer to UpToDate topic on \"Infusion reactions to systemic chemotherapy\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Infection prophylaxis:",
"        </strong>",
"        Not applicable. Refer to UpToDate topic on \"Use of granulocyte colony stimulating factors in patients with chemotherapy-induced neutropenia\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Dose adjustment for baseline liver dysfunction:",
"        </strong>",
"        For patients with liver dysfunction (bilirubin &gt;1.5 to 1.5 times the upper limit of normal [ULN] or AST &gt;ULN with a normal bilirubin), the dose of temsirolimus should be reduced to 15 mg. Temsirolimus is contraindicated for bilirubin &gt;1.5 times the ULN",
"        <sup>",
"         [2]",
"        </sup>",
"        . Refer to UpToDate topics on \"Chemotherapy hepatotoxicity and dose modification in patients with liver disease\" and \"Chemotherapy-related nephrotoxicity and dose modification in patients with renal insufficiency\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Monitoring parameters:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; CBC with differential and platelet count weekly during treatment.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; Serum electrolytes at baseline then every two to four weeks.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; Serum glucose, cholesterol, and triglycerides at baseline then every four weeks.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Suggested dose alterations for toxicity:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Myelotoxicity:",
"        </strong>",
"        Temsirolimus should not be administered if the absolute neutrophil count (ANC) is &lt;1000/mm",
"        <sup>",
"         3",
"        </sup>",
"        and/or platelet count is &lt;50,000/mm",
"        <sup>",
"         3",
"        </sup>",
"        . Withhold treatment until myelotoxicity resolves to grade 2 or less (ANC &gt;1000/mm",
"        <sup>",
"         3",
"        </sup>",
"        , platelets &gt;50,000/mm",
"        <sup>",
"         3",
"        </sup>",
"        ), then restart with a 5 mg per week dose reduction (minimum dose is 15 mg per week)",
"        <sup>",
"         [2]",
"        </sup>",
"        .",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <strong>",
"     This table is provided as an example of how to administer this regimen; there may be other acceptable methods. This regimen must be administered by a clinician trained in the use of chemotherapy. The clinician is expected to use his or her independent medical judgment in the context of individual circumstances to make adjustments, as necessary.",
"    </strong>",
"    <div class=\"footnotes\">",
"     IV: intravenous; AST: aspartate aminotransferase; CBC: complete blood count.",
"     <br/>",
"     * Total dose, not adjusted for weight or body surface area.",
"     <br/>",
"     &Delta; Administer through an inline 5-micron (or smaller), polyethersulfone filter. Do not use DEHP-containing (PVC) containers or administration sets",
"     <sup>",
"      [2]",
"     </sup>",
"     .",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br/>",
"     <ol>",
"      <li>",
"       Hudes G, et al. N Engl J Med 2007; 356:2271.",
"      </li>",
"      <li>",
"       Torisel (temsirolimus) injection. US FDA-approved manufacturer's package insert. US National Library of Medicine. (Available online at dailymed.nlm.nih.gov, accessed on December 8, 2011).",
"      </li>",
"     </ol>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
